import React from 'react';
import axios from 'axios';


export default class PostsPage extends React.Component{
        constructor(props){
          super(props);
          this.state = {posts: []};
        }
        componentDidMount(){
          axios.get('https://jsonplaceholder.typicode.com/posts').then((result)=>this.setState({
            posts: result.data
          }))
        }
        render(){
            return(
                <div>
                    {this.state.posts.map(post => 
                        <div className="post" key="post.id">
                        <div>{post.id}</div>
                        <div>{post.title}</div>
                        <div>{post.body}</div>
                    </div>                        
                        )}
                </div>
            )
        }
    }
